// Create a Map to track unique URLs
const urlSet = new Set();
const uniqueData = [];

// Loop through the data array
data.forEach(item => {
  // Check if the URL is already in the Set
  if (!urlSet.has(item.url)) {
    // If not, add it to the Set and the uniqueData array
    urlSet.add(item.url);
    uniqueData.push(item.url);
  }
});

